const AboutCinema = () => {
    return(
        <SafeAreaView>
        <Center safeArea flex={1} bgColor={'amber.100'}>
        <Image source={{uri: 'https://popcornandcandy.com/assets/output-onlinegiftools.gif'}} alt="Loading" />
        <Text>Loading...</Text>
        </Center>
        <Text>LoadPage</Text>
        </SafeAreaView>

    )
};

